class PrivacyandPolicy {
  PrivacyandPolicy({
    String? status,
    String? msg,
    Setting? setting,
  }) {
    _status = status;
    _msg = msg;
    _setting = setting;
  }

  PrivacyandPolicy.fromJson(dynamic json) {
    _status = json['status'];
    _msg = json['msg'];
    _setting =
        json['setting'] != null ? Setting.fromJson(json['setting']) : null;
  }

  String? _status;
  String? _msg;
  Setting? _setting;

  PrivacyandPolicy copyWith({
    String? status,
    String? msg,
    Setting? setting,
  }) =>
      PrivacyandPolicy(
        status: status ?? _status,
        msg: msg ?? _msg,
        setting: setting ?? _setting,
      );

  String? get status => _status;

  String? get msg => _msg;

  Setting? get setting => _setting;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['msg'] = _msg;
    if (_setting != null) {
      map['setting'] = _setting?.toJson();
    }
    return map;
  }
}

